import React, { useEffect, useState } from "react";
import "./ProductPage.css";
import productImage from "../Assets/products/1.jpg";
import productImage2 from "../Assets/products/2.jpg";
import productImage3 from "../Assets/products/3.jpeg";
import productImage4 from "../Assets/products/4.jpg";
import { useParams } from "react-router-dom";
import Slider from "react-slick";
const ProductPage = () => {
  const { id } = useParams();
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <>
      <div className="product-main-wrapper">
        <div className="product-left-side">
          <div className="img-container">
            <Slider {...settings}>
              <div>
                <h3>1</h3>
              </div>
              <div>
                <h3>2</h3>
              </div>
              <div>
                <h3>3</h3>
              </div>
              <div>
                <h3>4</h3>
              </div>
              <div>
                <h3>5</h3>
              </div>
              <div>
                <h3>6</h3>
              </div>
            </Slider>
          </div>
        </div>
        <div className="product-right-side"></div>
      </div>
    </>
  );
};

export default ProductPage;
